import React from "react";
import Nav from "./component/Nav";
import {Routes, Route } from "react-router-dom";
import About from './component/About'
import { Home } from "./component/Home";
const App = () => {
  return (
    <>
      <Nav />
      <Routes>
        <Route exact path="/" component={About} />
      </Routes>
    </>
  );
};
export default App;
